    {
      "cell_type": "code",
      "source": [
        "library(tidyverse)\n",
        "library(caret)"
      ],
      "metadata": {
        "id": "DUWUHT6lC9Gk"
      },
      "execution_count": null,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "data_raw <- read.csv(\"/content/apple_5yr_one.csv\", stringsAsFactors = FALSE)"
      ],
      "metadata": {
        "id": "_jk1EBi6DMXk"
      },
      "execution_count": null,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "data <- data_raw[-1, ]"
      ],
      "metadata": {
        "id": "IbYl_O3MDXeb"
      },
      "execution_count": null,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "data <- data %>%\n",
        "  mutate(\n",
        "    Close = as.numeric(Close),\n",
        "    Open = as.numeric(Open),\n",
        "    High = as.numeric(High),\n",
        "    Low = as.numeric(Low),\n",
        "    Volume = as.numeric(Volume)\n",
        "  )"
      ],
      "metadata": {
        "id": "dQ67qGXIDcaF"
      },
      "execution_count": null,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "data <- data %>% filter(if_all(c(Close, Open, High, Low, Volume), ~ !is.na(.) & is.finite(.)))"
      ],
      "metadata": {
        "id": "2Gg5MfV6Dgh8"
      },
      "execution_count": null,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "data <- data %>% mutate(PriceUp = as.factor(ifelse(Close > Open, 1, 0)))"
      ],
      "metadata": {
        "id": "hIdvmWB3DilZ"
      },
      "execution_count": null,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "table(data$PriceUp)"
      ],
      "metadata": {
        "colab": {
          "base_uri": "https://localhost:8080/",
          "height": 69
        },
        "id": "zVTtshU_gG_M",
        "outputId": "ac1da218-c1ba-4ce2-da2b-d7cd6b606866"
      },
      "execution_count": null,
      "outputs": [
        {
          "output_type": "display_data",
          "data": {
            "text/plain": [
              "\n",
              "  0   1 \n",
              "579 676 "
            ]
          },
          "metadata": {}
        }
      ]
    },
    {
      "cell_type": "code",
      "source": [
        "trainIndex <- createDataPartition(data$PriceUp, p = 0.8, list = FALSE)\n",
        "trainData <- data[trainIndex, ]\n",
        "testData <- data[-trainIndex, ]"
      ],
      "metadata": {
        "id": "lQJ9tpcdgSQG"
      },
      "execution_count": null,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "log_model <- glm(PriceUp ~ Open + High + Low + Volume,data = trainData, family = binomial)\n"
      ],
      "metadata": {
        "colab": {
          "base_uri": "https://localhost:8080/"
        },
        "id": "oaAG_P7GgYn6",
        "outputId": "3fb63e45-177a-4556-d9be-ac3231091cde"
      },
      "execution_count": null,
      "outputs": [
        {
          "output_type": "stream",
          "name": "stderr",
          "text": [
            "Warning message:\n",
            "“glm.fit: fitted probabilities numerically 0 or 1 occurred”\n"
          ]
        }
      ]
    },
    {
      "cell_type": "code",
      "source": [
        "prob_predictions <- predict(log_model, newdata = testData, type = \"response\")"
      ],
      "metadata": {
        "id": "rxgnXOItgjua"
      },
      "execution_count": null,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "class_predictions <- ifelse(prob_predictions > 0.5, 1, 0) %>% as.factor()"
      ],
      "metadata": {
        "id": "g1rh7BULgrTY"
      },
      "execution_count": null,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "conf_matrix <- confusionMatrix(class_predictions, testData$PriceUp, positive = \"1\")\n",
        "print(conf_matrix)"
      ],
