    {
      "cell_type": "code",
      "source": [
        "library(tidyverse)\n",
        "library(broom)\n",
        "\n",
        "coef_summary <- tidy(log_model, conf.int = TRUE)\n",
        "\n",
        "simulated_distributions <- coef_summary %>%\n",
        "  filter(term != \"(Intercept)\") %>%\n",
        "  rowwise() %>%\n",
        "  mutate(simulated = list(rnorm(1000, mean = estimate, sd = std.error))) %>%\n",
        "  unnest(cols = simulated)\n",
        "\n",
        "ggplot(simulated_distributions, aes(x = simulated, fill = term)) +\n",
        "  geom_density(alpha = 0.6, color = \"black\") +\n",
        "  facet_wrap(~ term, scales = \"free\", ncol = 2) +\n",
        "  geom_vline(data = coef_summary, aes(xintercept = conf.low), color = \"red\", linetype = \"dashed\") +\n",
        "  geom_vline(data = coef_summary, aes(xintercept = conf.high), color = \"red\", linetype = \"dashed\") +\n",
        "  geom_vline(data = coef_summary, aes(xintercept = estimate), color = \"blue\", linetype = \"solid\") +\n",
        "  labs(\n",
        "    title = \"Sampling Distributions of Logistic Regression Coefficients\",\n",
        "    x = \"Coefficient Estimate\",\n",
        "    y = \"Density\"\n",
        "  ) +\n",
        "  theme_minimal() +\n",
        "  theme(legend.position = \"none\")\n"
