      "cell_type": "markdown",
      "source": [
        "visualizing confusion matrix"
      ],
      "metadata": {
        "id": "dhVn5ifB7049"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "library(ggplot2)\n",
        "\n",
        "cm_data <- data.frame(\n",
        "  Reference = factor(rep(c(\"0\", \"1\"), each = 2), levels = c(\"0\", \"1\")),\n",
        "  Prediction = factor(rep(c(\"0\", \"1\"), 2), levels = c(\"0\", \"1\")),\n",
        "  Freq = c(94, 21, 21, 114)\n",
        ")\n",
        "\n",
        "ggplot(cm_data, aes(x = Reference, y = Prediction, fill = Freq)) +\n",
        "  geom_tile(color = \"white\") +\n",
        "  geom_text(aes(label = Freq), size = 6) +\n",
        "  scale_fill_gradient(low = \"white\", high = \"steelblue\") +\n",
        "  labs(\n",
        "    title = \"Confusion Matrix Heatmap\",\n",
        "    x = \"Actual values\",\n",
        "    y = \"Predicted values\"\n",
        "  ) +\n",
        "  theme_minimal() +\n",
        "  theme(\n",
        "    text = element_text(size = 14),\n",
        "    legend.position = \"none\"\n",
        "  )\n"
      ],
